const ProgressBar = (props) => {
    const { completeColor, completed } = props;

    const containerStyles = {
        height: 20,
        width: '100%',
        backgroundColor: "#e0e0de",
        borderRadius: 50,
        margin: 50
    }

    const fillerStyles = {
        height: '100%',
        width: `${completed}%`,
        backgroundColor: completeColor,
        borderRadius: 'inherit',
        textAlign: 'right'
    }

    const labelStyles = {
        padding: 5,
        color: 'black',
        fontWeight: 'bold',
        fontFamily: 'Inter',
        fontStyle: 'regular',
        fontSize: 14,
        /*Line height: 17px
        Line height: 100%
        Align: Center
        Vertical align: Top*/
    }

    return (
        <div style={containerStyles}>
            <div style={fillerStyles}>
                <span style={labelStyles}>{`${'1 неделя'}`}</span>
            </div>
        </div>
    );
};

export default ProgressBar;
